import './App.css';

import React from 'react';

const Nav = () => {
  return (
    <div className="App">
      <div className="container">
         <div className="nav">
          <h1>keshav</h1>
          <div className="navbar">
            <ul>
              <li>About</li>
              <li>Projects</li>
              <li>Contacts</li>
            </ul>
          </div>
         </div>
      </div>
    </div>
  );
}
